import React, { useEffect, useState } from 'react';
import { useMap } from 'react-leaflet';
import L from 'leaflet';
import { createCustomIcon, createBrandLogo } from '../utils/iconHelpers';

const IconMarkersLayer = ({ markers, selectedRegion }) => {
  const map = useMap();
  const markersRef = React.useRef({});
  const [iconsReady, setIconsReady] = useState(false);

  // Primero: Mostrar CircleMarkers (instant√°neo)
  useEffect(() => {
    if (!map || markers.length === 0) return;

    // Filtrar por regi√≥n
    const filteredMarkers = markers.filter(m => m.Region === selectedRegion);

    // Limpiar cualquier marcador anterior
    Object.values(markersRef.current).forEach(marker => {
      if (map.hasLayer(marker)) {
        map.removeLayer(marker);
      }
    });
    markersRef.current = {};

    console.log(`‚ö´ Mostrando ${filteredMarkers.length} CircleMarkers instant√°neamente...`);
    setIconsReady(false);

    // Renderizar CircleMarkers (MUY r√°pido)
    filteredMarkers.forEach((marker) => {
      const circleMarker = L.circleMarker([marker.lat, marker.lng], {
        radius: 6,
        fillColor: getColorByMarca(marker.Marca),
        color: '#fff',
        weight: 2,
        opacity: 1,
        fillOpacity: 0.85,
        className: 'temp-circle-marker'
      });

      // Popup simple
      const popupContent = `<strong>${marker.nombre}</strong>`;
      circleMarker.bindPopup(popupContent);
      circleMarker.addTo(map);
      markersRef.current[marker.id] = circleMarker;
    });

  }, [map, markers, selectedRegion]);

  // Segundo: Cargar los iconos en background (sin bloquear)
  useEffect(() => {
    if (!map || markers.length === 0) return;

    const filteredMarkers = markers.filter(m => m.Region === selectedRegion);

    // Esperar 500ms, luego reemplazar c√≠rculos con iconos
    const timeoutId = setTimeout(() => {
      console.log(`üéØ Reemplazando CircleMarkers con iconos...`);

      // Limpiar c√≠rculos
      Object.values(markersRef.current).forEach(marker => {
        if (map.hasLayer(marker)) {
          map.removeLayer(marker);
        }
      });
      markersRef.current = {};

      // Renderizar iconos en lotes
      let batchSize = 50;
      let currentBatch = 0;

      const renderBatch = () => {
        const start = currentBatch * batchSize;
        const end = Math.min(start + batchSize, filteredMarkers.length);
        
        for (let i = start; i < end; i++) {
          const marker = filteredMarkers[i];
          
          try {
            // Crear marcador con icono
            const leafletMarker = L.marker([marker.lat, marker.lng], {
              icon: createCustomIcon(marker.Marca),
              title: marker.nombre
            });

            // Popup completo
            const popupContent = `
              <div class="popup-container">
                <div class="popup-header">
                  <img 
                    src="${createBrandLogo(marker.Marca)}"
                    alt="${marker.Marca}"
                    style="width: 30px; height: 30px; border-radius: 50%; object-fit: cover; margin-right: 8px;"
                    onerror="this.style.display='none'"
                  />
                  <h3 style="margin: 0;">${marker.nombre}</h3>
                </div>
                <div class="popup-content">
                  <div class="popup-data">
                    <strong>Marca:</strong> ${marker.Marca}<br />
                    <strong>Region:</strong> ${marker.Region}<br />
                    <strong>Comuna:</strong> ${marker.Comuna}<br />
                    ${marker.direccion ? `<strong>Direcci√≥n:</strong> ${marker.direccion}<br />` : ''}
                    ${marker.eds ? `<strong>EDS:</strong> ${marker.eds}<br />` : ''}
                  </div>
                  <hr style="margin: 10px 0; border: none; border-top: 1px solid #e0e0e0" />
                  <div class="popup-data">
                    <strong>Precios:</strong><br />
                    G93: ${marker.precio_g93 ? `$${marker.precio_g93}` : 'N/A'}<br />
                    G95: ${marker.precio_g95 ? `$${marker.precio_g95}` : 'N/A'}<br />
                    Diesel: ${marker.precio_diesel ? `$${marker.precio_diesel}` : 'N/A'}<br />
                  </div>
                  ${marker.Guerra_Precio === 'Si' ? `
                    <hr style="margin: 10px 0; border: none; border-top: 1px solid #e0e0e0" />
                    <div class="popup-data" style="color: #d32f2f; font-weight: bold;">
                      ‚ö†Ô∏è Guerra de Precio Activa
                    </div>
                  ` : ''}
                </div>
              </div>
            `;

