            });

            leafletMarker.addTo(map);
            markersRef.current[marker.id] = leafletMarker;
          } catch (error) {
            console.error(`Error al renderizar marcador ${marker.id}:`, error);
          }
        }

        currentBatch++;
        
        if (end < filteredMarkers.length) {
          setTimeout(renderBatch, 50);
        } else {
          console.log(`‚úÖ ${filteredMarkers.length} iconos cargados completamente`);
          setIconsReady(true);
        }
      };

      renderBatch();
    }, 500); // Espera 500ms antes de cargar los iconos

    return () => {
      clearTimeout(timeoutId);
    };
  }, [map, markers, selectedRegion]);

  return null;
};

// Funci√≥n para obtener color seg√∫n marca
const getColorByMarca = (marca) => {
  const colors = {
    'Copec': '#FF6B00',
    'Petrobras': '#FFDA00',
    'Aramco': '#FF1744',
    'Shell': '#FFD700',
    'Blanco': '#FFFFFF',
    'Gulf': '#00B8E6',
    'Petroprix': '#8B00FF',
    'default': '#00B8A9'
  };
  return colors[marca] || colors.default;
};

export default IconMarkersLayer;
